import React, { Component } from 'react';
import './App.css';
import { Alert } from 'reactstrap';
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
  Button } from 'reactstrap';

  export default class Example extends React.Component {
    constructor(props) {
      super(props);

      this.toggle = this.toggle.bind(this);
      this.state = {
        isOpen: false
      };
    }

    toggle() {
      this.setState({
        isOpen: !this.state.isOpen
      });
    }
    render() {
      const mainBody = {
        border: '1px solid gray', 
        backgroundcolor: 'red',
        height: '500px'
      };
      const navbarText = {
        color: '#B9F7F3'
      };

      const backContainer = {
        height: '700px',
        width: '90%',
        backgroundcolor: 'white'
      };

      const constheader = {
        width: '75%',
        height: '20%'
      };

      const spacingContainer = {
        height: '40px'
      };

      const promptText = {
        color: '#2D9E8F'
      };

      const centerContainer = {
        height: '40%'
      };

      const getStartedContainer = {
        width: '50%',
        height: '50%'
      };
      return (
        <div>
          <nav class="navbar sticky-top navbar-expand-lg navbar-light" style={navbar}>
                    <h1 class="float-right display-5 text-black-50 font-weight-bold">Health Is Wealth</h1>
                    <ul class="navbar-nav mr-auto">
                            <form class="form-inline my-2 my-lg-0 p-2">
                                    <a class="nav-link" href="#"><h4 id="navbarText" class="pl-5 text-white-50">Home</h4></a>
                                    <a class="nav-link" href="#"><h4 id="navbarText" class="pl-5 text-white-50">Tests</h4></a>
                                    <a class="nav-link" href="#"><h4 id="navbarText" class="pl-5 text-white-50">About Us</h4></a>
                            </form>
                    </ul>
                    {/* <img src="images/logo.png" alt="GC" width="70" height="70"></img> */}
            </nav>

            <div class="container mx-auto" style={backContainer}>
              <div id="header" class="containter text-center pt-3 mx-auto">
                  <h1 class="pb-2 mb-2 border-bottom">Welcome to our project!</h1>
              </div>

              <div class="container shadow-lg p-3 mb-5 bg-white rounded" style={mainBody}>
                  <div class="container" style={spacingContainer}></div>
                  <div class="containter text-center pt-3 mx-auto" style={centerContainer}>
                      <h1 class="display-3 title" style={promptText}>Click Below To Begin</h1>
                  </div>

                  <div class="containter text-center pt-3 mx-auto" style={getStartedContainer}>
                      <button type="button" class="btn btn-outline-dark text-center">Get Started</button>
                  </div>
                  <div class="mask"></div>
              </div>
            </div>
        </div>
      );
  }
}
